import React, { Component } from "react";

class Like extends React.Component {
  render() {
    return (
      <i
        onClick={this.props.onClick}
        style={{ cursor: "pointer" }}
        className={this.props.isClick ? "fa fa-heart" : "fa fa-heart-o"}
        aria-hidden="true"
      ></i>
    );
  }
}

export default Like;
